class s{static parse(e){if(!e)return{board:"Unknown",type:"Other",rawUrl:e};const r=e.split("/").pop()||"";return e.includes("aqa.org.uk")?this.parseAQA(r,e):e.includes("pearson.com")||r.includes("9MA0")||r.includes("8MA0")?this.parseEdexcel(r,e):e.includes("ocr.org.uk")?this.parseOCR(r,e):{board:"Unknown",type:"Other",rawUrl:e}}static parseAQA(e,r){const a=/AQA-([A-Z0-9]+)-([A-Z]+)-([A-Z]+)(\d{2})/i,t=e.match(a);return t?{board:"AQA",subjectCode:t[1],type:this.mapType(t[2]),month:this.mapMonth(t[3]),year:"20"+t[4],rawUrl:r}:{board:"AQA",type:"Other",rawUrl:r}}static parseEdexcel(e,r){const a=/([A-Z0-9]+)_(\w+)_(\w+)_(\d{4})(\d{2})(\d{2})/,t=e.match(a);return t?{board:"Edexcel",subjectCode:t[1],type:this.mapType(t[3]),year:t[4],month:this.mapMonthNumber(t[5]),rawUrl:r}:{board:"Edexcel",type:"Other",rawUrl:r}}static parseOCR(e,r){return{board:"OCR",type:e.includes("question-paper")?"Question Paper":e.includes("mark-scheme")?"Mark Scheme":"Other",subjectCode:e.split("-")[0],rawUrl:r}}static mapType(e){const r=e.toUpperCase();return r==="QP"||r==="QUE"?"Question Paper":r==="MS"||r==="RMS"?"Mark Scheme":r==="ER"||r==="REP"?"Examiner Report":"Other"}static mapMonth(e){const r=e.toUpperCase();return r==="JUN"?"June":r==="NOV"?"November":r==="JAN"?"January":e}static mapMonthNumber(e){return e==="06"?"June":e==="11"?"November":e==="01"?"January":e}}export{s as S};
